 it, \"Another useless piece of antiquarian junk!\"\\n\\nWhat fun!',['title']='Phedre\\'s Journal, Entry 2',},['Z']=56887,['Pitch']=4.712564,['Roll']=0,},[3]={['Alpha']=1,['X']=56575,['SizeY']=30,['Yaw']=1.651081,['Y']=28985,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1035,['EffectType']=8501,['Color']=499,['Groups']=0,['MetaData']={['message']='Disaster! Some foul river creature has attacked the steamer!\\n\\nThe captain has ordered the crew to swim for shore, but the river is teeming with befanged creatures.\\n\\nThis may be my last entry.',['title']='Phedre\\'s Journal, Entry 3',},['Z']=61516,['Pitch']=4.712564,['Roll']=0,},[4]={['Alpha']=1,['X']=58437,['SizeY']=30,['Yaw']=3.637266,['Y']=28891,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1036,['EffectType']=8501,['Color']=30499,['Groups']=0,['MetaData']={['message']='I have made it to shore, but several of the crew were not so lucky.\\n\\nThe survivors managed to dry out around a bonfire, but this attracted natives from the jungle.\\n\\nUnhappily they appear to be canibals, and I have been forced to flee upriver, with those of us with enough limbs to walk.',['title']='Phedre\\'s Journal, Entry 4',},['Z']=64712,['Pitch']=5.372123,['Roll']=0,},[5]={['Alpha']=1,['X']=56581,['SizeY']=30,['Yaw']=3.117158,['Y']=28875,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1037,['EffectType']=8501,['Color']=30099,['Groups']=0,['MetaData']={['message']='I have found a cave near the falls. It is filled with colorful rock drawings and strange flora.\\n\\nThankfully, the natives seem relucant to come near the entrance.\\n\\nIt appears like the cave extends into the plateau and with luck there may be another exit that will take us towards the dig site.',['title']='Phedre\\'s Journal, Entry 5',},['Z']=69333,['Pitch']=4.974188,['Roll']=0,},[6]={['Roll']=0,['Yaw']=1.991421,['X']=61918,['Y']=30623,['SizeX']=1220,['Contrast']=0.590000,['SizeZ']=1380,['Id']=1046,['EffectType']=85,['Color']=789959,['Groups']=0,['SizeY']=1380,['Z']=73430,['Pitch']=0,['Alpha']=1,},[7]={['Roll']=0,['Yaw']=1.991421,['X']=61927,['Y']=30553,['SizeX']=1480,['Contrast']=1,['SizeZ']=1524,['Id']=1047,['EffectType']=644,['Color']=292929,['Groups']=0,['SizeY']=1524,['Z']=73434,['Pitch']=0,['Alpha']=1,},[8]={['Roll']=0,['Yaw']=1.991421,['X']=61297,['Y']=31314,['SizeX']=1220,['Contrast']=0.590000,['SizeZ']=1380,['Id']=1049,['EffectType']=85,['Color']=789959,['Groups']=0,['SizeY']=1380,['Z']=73724,['Pitch']=4.712564,['Alpha']=1,},[9]={['Roll']=0,['Yaw']=2.165954,['X']=63037,['Y']=30014,['SizeX']=1620,['Contrast']=0.590000,['SizeZ']=2980,['Id']=1050,['EffectType']=85,['Color']=789959,['Groups']=0,['SizeY']=2980,['Z']=72506,['Pitch']=4.712564,['Alpha']=1,},[10]={['Roll']=0,['Yaw']=0,['X']=65054,['Y']=22467,['SizeX']=150000,['Contrast']=1,['SizeZ']=150000,['Id']=1053,['EffectType']=909,['Color']=223345,['Groups']=0,['SizeY']=150000,['Z']=73159,['Pitch']=0,['Alpha']=1,},[11]={['Roll']=0,['Yaw']=5.302310,['X']=65159,['Y']=30485,['SizeX']=120000,['Contrast']=0.620000,['SizeZ']=120000,['Id']=1054,['EffectType']=533,['Color']=265874,['Groups']=0,['SizeY']=120000,['Z']=73081,['Pitch']=0,['Alpha']=1,},[12]={['Alpha']=1,['X']=61733,['SizeY']=30,['Yaw']=2.509783,['Y']=30443,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1056,['EffectType']=8501,['Color']=99,['Groups']=0,['MetaData']={['message']='I have reached the upper falls on the plateau. This is a bleak and unforgiving landscape.\\n\\nI hope I can find Professor von Bunny\\'s camp site before I starve to death among these rocks.',['title']='Phedre\\'s Journal, Entry 6',},['Z']=71823,['Pitch']=4.806637,['Roll']=0,},[13]={['Alpha']=1,['X']=64373,['SizeY']=30,['Yaw']=1.153663,['Y']=30545,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1057,['EffectType']=8501,['Color']=30099,['Groups']=0,['MetaData']={['message']='I have finally arrived at Professor von Bunny\\'s camp!\\n\\nThe professor seems unconcerned about the loss of the supplies, and has put me to work straight away.\\n\\nThe professor seems quite manic, rushing about the dig site, taking measurements, and muttering about treasures greater than gold.',['title']='Phedre\\'s Journal, Entry 7',},['Z']=70047,['Pitch']=4.712564,['Roll']=0,},[14]={['Alpha']=1,['X']=69604,['SizeY']=30,['Yaw']=6.072000,['Y']=30025,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1058,['EffectType']=8501,['Color']=99,['Groups']=0,['MetaData']={['message']='Professor von Bunny is quite mad! He is seeking the secret of eternal life but instead has dug up eternal death!\\n\\n... some things are not meant to be uncovered\\n\\n... some things are buried for a reason\\n\\nThe fool has freed THE WUEBEN from the weight of his eternal tomb!\\n\\nI must flee to warn the world. Our doom is upon us!\\n\\n(the jounral is signed)\\n- Lucy Phedre\\n(also know as Danger Lucy)\\n\\n*Any resemblence of these characters to actual Divine Design Alliance Guild Mistresses or Masters, living, dead, or undead,  is purely coincidental',['title']='Phedre\\'s Journal, Final Entry',},['Z']=63288,['Pitch']=4.708898,['Roll']=0,},[15]={['Alpha']=1,['X']=65574,['SizeY']=30,['Yaw']=0.212930,['Y']=30419,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1059,['EffectType']=8501,['Color']=11499,['Groups']=0,['MetaData']={['message']='The workers at the dig site seem strangely unenthusatic, almost like they are in some kind of trance.\\n\\nThey just dig and dig, with no excitement at the incredible finds they uncover.',['title']='Phedre\\'s Journal, Entry 8',},['Z']=65913,['Pitch']=1.570971,['Roll']=0,},[16]={['Alpha']=1,['X']=68037,['SizeY']=30,['Yaw']=5.600762,['Y']=30418,['SizeX']=26.456456,['Contrast']=1,['SizeZ']=30,['Id']=1061,['EffectType']=8501,['Color']=699,['Groups']=0,['MetaData']={['message']='We have found an ancient tomb buried amongst the rocks of the plateau!\\n\\nWe are digging deeper to find the treasure rooms of this burial site. What fabulous antiquities will we find here?',['title']='Phedre\\'s Journal, Entry 9',},['Z']=65110,['Pitch']=1.570971,['Roll']=0,},},['TS']=1603122339,['Version']='15.7.9',['HouseId']=71,['World']='na',},[12]={['Effects']={[1]={['Roll']=0,['Yaw']=2.029818,['X']=155671,['Y']=28169,['SizeX']=1160,['Contrast']=1,['SizeZ']=1360,['Id']=1060,['EffectType']=644,['Color']=292929,['Groups']=0,['SizeY']=1360,['Z']=160126,['Pitch']=0,['Alpha']=1,},},['TS']=1602651783,['Version']='15.7.6',['HouseId']=81,['World']='na',},[13]={['Effects']={[1]={['Roll']=0,['Yaw']=2.897247,['X']=109629,['Y']=20549,['SizeX']=220,['Contrast']=1,['EffectType']=926,['Id']=1090,['SizeZ']=100,['Color']=688899,['Groups']=0,['SizeY']=220,['Z']=106979,['Pitch']=0,['Alpha']=1,},},['TS']=1607884889,['Version']='16.0.1',['HouseId']=80,['World']='na',},[14]={['Effects']={[1]={['Alpha']=1,['Yaw']=0,['X']=39980,['Y']=1,['SizeX']=150000,['Contrast']=1.540000,['EffectType']=909,['Id']=1114,['SizeZ']=150000,['Color']=150059,['Groups']=0,['SizeY']=150000,['Z']=80960,['Pitch']=0,['Roll']=0,},[2]={['Roll']=0,['X']=39986,['Yaw']=0.251327,['Y']=12440,['MetaData']={['message']='Dear Reader,\\n\\nIn my role as Exquistitor Intraordinary for the Psijic Eediocy I was recently dispatched to investigate and report on the terrible outrages committed in Vardenfell, north of Gnisis, in the lead up to this years annual \"Festival of Hearts and Sexual Organs\", also refered to as \"Valentine\\'s Day\" by some, mostly pedantic Dwemer scholars.\\n\\nMy investigation was prompted by the following short note found near the scene of a brutal slaying in Vivec City. It was first supposed that this killing was the usual hourly, or perhaps minutely, occurance of a mugging in that violet city, however upon reading this note my blood ran cold, ... or perhaps colder, since that nasty bite I received some while ago has left left me rather chilled ... but I digress! The note:\\n\\n\"They thought I dead, but I have survived! I will not be defeated by a mere run-away bride! I will show them! I will show them all! I shall build a new bride, a bride to tower over the world, a bride of vengence and destuction!. They shall all cower before me, begging for their lives and longing for my love! If only I had a heart to give ... oh here\\'s one over here *snip* yes, that should do nicely! - Dr Julius Frankenbunny\"\\n\\nDear reader, the reports of Dr Frankenbunny\\'s death after that deplorable incident at Velothi Reverie, in the village of Narsis in Deshaan last year, were greatly exaggerated. He lives! Or perhaps lives again.\\n\\nIn any case it is my sad duty to inform you to EVACUATE IMMEDIATELY from the district of Vvardenfell. It appears this feind has constructed himself a new, even more terrible bride. He has created a Giant Atomic Powered Moble Romance Fortress and is marauding across the land bent on conquest, destruciton and romantic enslavement!\\n\\nFLEE! FLEE FOR YOUR LIVES!',['title']='The Return of Dr Frankenbunny',},['SizeX']=65.456456,['Contrast']=1,['SizeY']=70,['Id']=1116,['EffectType']=8503,['Color']=320099,['Groups']=0,['SizeZ']=70,['Z']=81060,['Pitch']=4.852015,['Alpha']=1,},},['TS']=1610195348,['Version']='16.0.9',['HouseId']=44,['World']='na',},[15]={['Effects']={[1]={['Alpha']=1,['X']=52473,['Yaw']=2.530727,['Y']=9541,['MetaData']={['message']='\" ... what is this loneliness that grinds away at my soul? I long for company in my mansion. Why can I find noone that shares my passions?\"\\n\\n\" ... the depression ebbs, replaced by rage! Am I to be alone forever? What sin have I commited to warrant such a pennance?\"\\n\\n\"... my rage has focused my mind! I see it clearly now. What God has refused to provide, I, Dr Frankenbunny, shall create!\"\\n\\n\"... all is ready! Today my beautiful creation shall live. The flux capacitors are charging nicely, and tonight I shall throw the switch and charge my love with life!\"\\n\\n\"... I do not know how I have failed! My creation rose from the table coursing with 1.21 Gigawatts of love. But as I called my freshly arisen lover to embrace me, her cold blank eyes looked through me as she spoke her first words: \\t\"... Arrrgh ... what ... have you done ... for me ... lately\"\\n\\n\"... It is no use she is too strong, I can no longer restrain her. She has smashed the main door open has is heading out into the village!\"\\n\\n\"... the screaming has mostly stopped now. But I can hear another noise. The sound of voices raised in anger. I can see many torches in the darkness, wending their way up the pathway to my house.\"\\n\\n\"... they are in the house! I have barricaded myself in my study, and am trying to record as much of this night as I can bare to recall. They are here! Smashing at my barricade, I mus ...\"',['title']='Exterts from the Journal of Dr Frankenbunny',},['SizeX']=46.456456,['EffectType']=8503,['SizeZ']=50,['Id']=1117,['Contrast']=1,['Color']=280799,['Groups']=0,['SizeY']=50,['Z']=46399,['Pitch']=4.712564,['Roll']=0,},},['TS']=1610249376,['Version']='16.0.9',['HouseId']=20,['World']='na',},},['TS']=1635650232,['Key']='fx__@researchmonkey',}"
