engeld, welches du mir zur Verfügung gestellt hast, haben doch zu einem ganz hübschen Ergebnis geführt. \\n\\nIch hoffe, dass du dein Haus geniesst...\\n\\nGrüße und tausend Küsse, Edwina\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nBeloved husband,\\n\\n\\n\\nRefusing EHT as you do, I\\'m afraid this message will never reach you. But still, I feel the need to tell you this:\\n\\nWhen I started building this house I wasn\\'t too convinced, myself. But your efforts to cheer me up and most generous allowance enabled me to create quite a lovely dwelling which I sure do hope you\\'ll enjoy.\\n\\n\\n\\nA thousand kisses,\\n\\nEdwina',},['Y']=26813,['SizeZ']=50,['Roll']=0,['SizeX']=46.456456,['Yaw']=3.019420,['Id']=1039,['EffectType']=8503,['Z']=20427,['Contrast']=1.380000,['X']=26830,['Color']=46766,['Pitch']=5.497787,['SizeY']=50,['Groups']=0,},[3]={['Id']=1041,['Y']=27100,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=3.054326,['EffectType']=871,['Z']=20217,['Contrast']=2.500000,['X']=29125,['Color']=399939,['Pitch']=0,['SizeY']=1000,['Groups']=0,},[4]={['Id']=1042,['Y']=27100,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=4.450590,['EffectType']=871,['Z']=19959,['Contrast']=2.340000,['X']=30050,['Color']=399939,['Pitch']=0,['SizeY']=1000,['Groups']=0,},[5]={['Id']=1043,['Y']=27625,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=4.712389,['EffectType']=871,['Z']=19700,['Contrast']=2.560000,['X']=29870,['Color']=399939,['Pitch']=0,['SizeY']=1000,['Groups']=0,},[6]={['Id']=1044,['Y']=27725,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=3.141593,['EffectType']=871,['Z']=20074,['Contrast']=1,['X']=29115,['Color']=399939,['Pitch']=0,['SizeY']=1000,['Groups']=0,},[7]={['Id']=1045,['Y']=27725,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=3.141593,['EffectType']=871,['Z']=20074,['Contrast']=1,['X']=29115,['Color']=399939,['Pitch']=0