,['Yaw']=0,['EffectType']=614,['Color']=494949,['Contrast']=1,['X']=0,['Z']=0,['Pitch']=0,['SizeY']=100,['Groups']=0,},[4]={['Id']=1060,['Y']=20552,['SizeZ']=6600,['Roll']=0,['SizeX']=9400,['Alpha']=1,['Yaw']=1.570796,['EffectType']=834,['Color']=122835,['Contrast']=1.160000,['X']=34678,['Z']=52208,['Pitch']=0,['SizeY']=6600,['Groups']=0,},[5]={['Id']=1061,['Alpha']=1,['Y']=19648,['SizeZ']=300,['Roll']=0,['SizeX']=130,['Yaw']=4.712389,['MetaData']={['message']='Keep your hands in your pockets!!!',['name']='Guard',},['EffectType']=5018,['Z']=52921,['Contrast']=1,['X']=34503,['Color']=696969,['Pitch']=0,['SizeY']=300,['Groups']=0,},[6]={['Id']=1062,['Y']=0,['SizeZ']=100,['Roll']=0,['SizeX']=100,['Alpha']=0.790000,['Yaw']=0,['EffectType']=54,['Color']=52939,['Contrast']=1,['X']=0,['Z']=0,['Pitch']=0,['SizeY']=100,['Groups']=0,},},['TS']=1607106638,['HouseId']=24,},[9]={['World']='eu',['Version']='16.0.9',['Effects']={[1]={['Id']=1063,['Alpha']=1,['Y']=10554,['SizeZ']=230,['Roll']=0,['SizeX']=226.456456,['Yaw']=0.523599,['MetaData']={['message']='Was für ein furchtbarer Tag, Igor liegt im Sterben!\\n\\nDer tapfere Inspektor Tythis hat seine besten Kräfte mobilisiert, um zu ergründen, welcher der anwesenden Gäste im Herrenhaus die grausame Tat begangen hat.\\n\\nWar es die Schmugglerin Piharri mit den Kontakten zur Unterwelt und den klebrigen Fingern?\\n\\nOder doch der arrogante Nord?\\n\\nHat sich unsere Phedre in dunkle Machenschaften verstrickt?\\n\\nWar es am Ende doch der Gelehrte Biro-Dar, der Hausherr, der sich in seinen Studien gestört fühlte?\\n\\nFinden wir es heraus...\\n\\n\\n\\n\\nMurder at the manor\\n\\nWhat a horrible day, Igor is dying!\\n\\nInspector Tythis valiantly tasked his best officers with finding out who among the guests at the manor did the deed.\\n\\nWas it Piharri, the smuggler with sticky fingers and connections to society\\'s underbelly?\\n\\nOr the arrogant Nord?\\n\\nHas Phedre gotten entangled in in dark machinations?\\n\\nOr was it Biro-Dar the scholar, also our host, who couldn\\'t bear to see his studies interrupted?\\n\\nLet\\'s find out...',['title']='Mord im Herrenhaus',},['EffectType']=8502,['Color']=82135,['Contrast']=1.840000,['X']=104181,['Z']=89017,['Pitch']=5.497787,['SizeY']=230,['Groups']=0,},[2]={['Id']=1077,['Y']=14173,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=4.712389,['EffectType']=525,['Pitch']=0,['Contrast']=4,['X']=67588,['Z']=81315,['Color']=990643,['SizeY']=1000,['Groups']=0,},[3]={['Id']=1079,['Y']=14134,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=4.712389,['EffectType']=525,['Pitch']=0,['Contrast']=4,['X']=68360,['Z']=80711,['Color']=990352,['SizeY']=1000,['Groups']=0,},[4]={['Id']=1080,['Y']=14432,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=1.570796,['EffectType']=871,['Pitch']=0,['Contrast']=2.610000,['X']=62032,['Z']=77573,['Color']=209123,['SizeY']=1000,['Groups']=0,},[5]={['Id']=1083,['Y']=14112,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=1.570796,['EffectType']=871,['Pitch']=0,['Contrast']=4,['X']=64425,['Z']=74945,['Color']=799900,['SizeY']=1000,['Groups']=0,},[6]={['Id']=1084,['Y']=14132,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=0,['EffectType']=871,['Pitch']=0,['Contrast']=4,['X']=65953,['Z']=75194,['Color']=929900,['SizeY']=1000,['Groups']=0,},[7]={['Id']=1085,['Y']=14775,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=0,['EffectType']=871,['Pitch']=0,['Contrast']=3.330000,['X']=70094,['Z']=76765,['Color']=649903,['SizeY']=1000,['Groups']=0,},[8]={['Id']=1096,['Y']=13587,['SizeZ']=1200,['Roll']=0,['SizeX']=1200,['Alpha']=1,['Yaw']=4.712389,['EffectType']=633,['Pitch']=0,['Contrast']=1,['X']=64203,['Z']=81267,['Color']=999999,['SizeY']=1200,['Groups']=0,},[9]={['Id']=1098,['Y']=15739,['SizeZ']=700,['Roll']=0,['SizeX']=300,['Alpha']=1,['Yaw']=0,['EffectType']=88,['Pitch']=0,['Contrast']=1,['X']=64354,['Z']=78979,['Color']=594949,['SizeY']=700,['Groups']=0,},[10]={['Id']=1099,['Y']=15733,['SizeZ']=700,['Roll']=0,['SizeX']=400,['Alpha']=1,['Yaw']=0.069813,['EffectType']=86,['Pitch']=0,['Contrast']=1,['X']=64419,['Z']=79005,['Color']=594949,['SizeY']=700,['Groups']=0,},[11]={['Id']=1101,['Alpha']=1,['Y']=13775,['SizeZ']=50,['Roll']=0,['SizeX']=46.456456,['Yaw']=4.014257,['MetaData']={['message']='20. Zweitsaat, Feuerfest\\n\\n\\n\\nWie immer, habe ich meine verehrten Freunde eingeladen, mir über Zweitsaat und Jahresmitte Gesellschaft zu leisten. Ich freue mich auf die erbaulichen Gespräche und fruchbaren Diskussionen!\\n\\n\\n29. Zweitsaat\\n\\n\\n\\nLiebe liegt in der Luft!\\n\\nNormalerweise kümmern mich die Belange meiner Bediensteten nicht. Nuzimeh ist jedoch schon so lange in meinen Diensten, dass ich nicht umhin komme, ihre Liebelei mit dem jungen Wächter, den ich kürzlich anstellte, zu bemerken.\\n\\n\\n15. Mittjahr\\n\\n\\n\\noh Graus! Mein treuer Diener Igor wurde hinterrücks erdolcht. Ich denke nicht, dass er bleibende Schäden zurück behält, aber dennoch...!\\n\\nSobald diese furchtbaren Polizisten, die sich niemals die Schuhe abtreten, den Mörder oder die Mörderin gefunden haben, werde ich diese Zusammenkünfte überdenken. \\n\\nZum Glück konnte ich den hinteren Garten absperren, ich möchte nicht, dass diese Kretins mir die Blumen zertrampeln.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nDiary\\n\\nSecond Seed 20th, Fire Festival\\n\\nAs usual I have invited my honoured friends to keep me company during Second Seed and Mid Year. I look forward to uplifting chats and productive conversations\\n\\nSecond Seed, 29th\\n\\nLove is in the air!\\nI don\\'t normally pay attention to the help\\'s private matters. But Nuzhimeh has been with me for so long how that I cannot help but notice her flirtation with the young guard I recently hired. \\n\\nMid Year 15th\\n\\nOh what a dreadful affair! My trusty servant Igor has been stabbed from behind! I don\\'t think there\\'ll be any lasting damage, but still...!\\n\\nAs soon as these loathsome policemen who track dirt everywhere have found the would-be killer I will have to rethink these gatherings.\\n\\nLuckily I\\'ve been able to block access to the back garden, I wouldn\\'t want the cretins to trample my flowers.',['title']='Tagebuch',},['EffectType']=8503,['Color']=799,['Contrast']=0.730000,['X']=65020,['Z']=76636,['Pitch']=1.483530,['SizeY']=50,['Groups']=0,},[12]={['Id']=1102,['Alpha']=1,['Y']=13469,['SizeZ']=300,['Roll']=0,['SizeX']=130,['Yaw']=4.712389,['MetaData']={['message']='Go on, young Constable!\\nFind the one, that\\'s responsible for this attempted murder...',['name']='Inspector Tythis',},['EffectType']=5018,['Color']=696969,['Contrast']=1,['X']=65485,['Z']=79196,['Pitch']=0,['SizeY']=300,['Groups']=0,},[13]={['Id']=1107,['Alpha']=1,['Y']=14275,['SizeZ']=50,['Roll']=0,['SizeX']=46.456456,['Yaw']=4.625123,['MetaData']={['message']='(viele Seiten fehlen, sind herausgerissen)\\n\\n\\n\\n...was treibt sich diese Nuzhimeh immer vorne am Gartentor herum? Hat die nichts besseres zu tun? Abwasch machen oder Wäsche waschen?...Es ist zum Mäuse melken! ...\\nUnd diese Schmugglerin...wie hat sie es denn geschafft, in den Garten zu kommen?? Irgendwie muss sie das doch geschafft haben!\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nTattered Journal\\n\\n(Many pages have been ripped out and are nowhere in sight)\\n\\nWhat is this Nuzhimeh person doing, moping around at the garden gate all the time? Doesn\\'t she have anything else to do? I don\\'t know, dishes, or laundry! It\\'s enough to drive anyone up the wall!\\nAnd this little smuggler, how did she pass the guard?',['title']='Zerfleddertes Tagebuch',},['EffectType']=8503,['Color']=3653,['Contrast']=0.730000,['X']=67693,['Z']=76049,['Pitch']=1.570971,['SizeY']=50,['Groups']=0,},[14]={['Id']=1108,['Alpha']=1,['Y']=14333,['SizeZ']=50,['Roll']=0,['SizeX']=46.456456,['Yaw']=0.959931,['MetaData']={['message']='\\n\\n21. Zweitsaat\\n\\nWie liebe ich dieses Haus und die superben Gespräche, die man hier führen kann. Besonders meinem Gastgeber Biro-Dar bin ich zu Dank verpflichtet.\\n\\n\\n\\n\\n23. Zweitsaat\\n\\nHeute Abend hatten wir das bisher beste Gespräch: \"Met mit Mondzucker würzen, gute Idee?\" Bis Pirarri eine Szene machte, weil sie eine Süßkringelsüchtige Irre ist. Mondzucker hin, Mondzucker her.\\n\\n\\n\\n\\n\\n\\n15. Mittjahr\\n\\nAlso dass der Lakai von Biro-Dar angestochen wurde ist äußerst ärgerlich! Aber dieser Inspektor Tythis ist ein lecker Schnittchen! Diese männliche Ausstrahlung und wie das Licht der Laternen sich auf seinem Haupt spiegelt...\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nPerfumed Diary\\n\\nSecond Seed 21st\\n\\nHow I love this house and the brilliant conversation to be had here. I am especially grateful to our host Biro-Dar.\\n\\n\\n\\nSecond Seed 23rd\\n\\nTonight, we had the best exchange so far: \"Spicing minced meat with moon sugar: yes or no?\" Until Pirharri threw a fit, the crazed sweetroll addict.\\n\\nMoonsugar or no moonsugar.\\n\\n\\n\\nMid Year 15th\\n\\nWhile it is quite annoying that Biro-Dar\\'s manservant has been stabbed, Inspector Tythis really is pretty enough to eat. The manly aura, the way his skin reflects the light...',['title']='Stark parfümiertes Tagebuch',},['EffectType']=8503,['Color']=2907,['Contrast']=0.730000,['X']=67458,['Z']=76887,['Pitch']=1.570971,['SizeY']=50,['Groups']=0,},[15]={['Id']=1109,['Alpha']=1,['Y']=14373,['SizeZ']=50,['Roll']=0,['SizeX']=46.456456,['Yaw']=3.054326,['MetaData']={['message']='(Die Seiten fühlen sich klebrig an, sind teilweise zusammen gepappt)\\n\\n\\nPirharri muss unbedingt berichten, wie verzaubert diese von köstlichen Süßkringeln aus Nuzimehs Küche ist! \\n\\n\\n\\nHelle Monde! Diese Glasur, dieser Teig! Welch wohliges, warmes Gefühl sich in dieser ausbreitet, wenn sie einen gegessen hat! \\n\\n\\n\\nNie wieder wird Piharri so viel für irgendetwas empfinden!\\n\\n\\n\\n(du bemerkst, dass weiter hinten im Buch noch einige hin gekritzelte Notizen sind...)\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n...Schuppen ist gruselig...\\n\\n\\nniemals...\\n\\n\\n\\n\\n\\n...lungert nervös davor herum...\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nPirharri\\'s sticky journal\\n\\n(The pages feel sticky and some of them are stuck to each other)\\n\\nThis one has to say she is enchanted by the delicious sweetrolls from Nuzhimeh\\'s kitchen! The frosting, the pastry, that feeling this one feels after eating one of them!\\n\\nThis one will never feel such passion for anything else.\\n\\n\\n\\n(You notice a few entries scrawled into the back of the book.)\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n...shed is scary...\\n\\nnever...\\n\\n\\n\\nloitering nervously in front of it...',['title']='Pirharri\\'s klebriges Tagebuch',},['EffectType']=8503,['Color']=969908,['Contrast']=0.730000,['X']=69047,['Z']=77355,['Pitch']=1.570971,['SizeY']=50,['Groups']=0,},[16]={['Alpha']=1,['Id']=1110,['Y']=13984,['SizeZ']=30,['Roll']=0,['SizeX']=26.456456,['Yaw']=0,['MetaData']={['message']='\\n\\nDrachenflug - Craglorn - 12.000 G (stingy)\\n\\nFenjano - Hew\\'s Bane - 15.000 G (naive bastard)\\n\\nCami - Tamriel - 15.000 G (generous donor)\\n\\nShours - Goldcoast - 18.000 G (hah!)\\n\\nTydry - Coldharbour - 20.000 G (big boy)\\n\\nCyberqueen - 10.000 G each map that i\\'ll \"find\" (couldn\\'t negotiate anymore)\\n\\nStabbityDoom - gave me a bag of buttons last time',['title']='Verkäufe/Sells',},['EffectType']=8503,['Color']=990046,['Contrast']=1.450000,['X']=61443,['Z']=75251,['Pitch']=4.712564,['SizeY']=30,['Groups']=0,},[17]={['Id']=1114,['Y']=13651,['SizeZ']=1000,['Roll']=0,['SizeX']=1000,['Alpha']=1,['Yaw']=3.141593,['EffectType']=100