aid goodbye',},['X']=83641,['EffectType']=8503,['Yaw']=3.141593,['Y']=37045,['Groups']=0,['Id']=1042,['Pitch']=0,},},['Version']='16.3.5',['HouseId']=47,['World']='eu',['TS']=1626620584,},[2]={['World']='eu',['Version']='16.3.5',['HouseId']=45,['Effects']={[1]={['Color']=459995,['Z']=79596,['Alpha']=1,['Contrast']=0.390000,['SizeX']=1020,['SizeZ']=1280,['Pitch']=0,['Id']=1005,['SizeY']=1280,['EffectType']=465,['Yaw']=4.712390,['Y']=11290,['Groups']=0,['X']=59505,['Roll']=0,},[2]={['Color']=33000,['Z']=79507,['Alpha']=0.640000,['Contrast']=1.300000,['SizeX']=1300,['SizeZ']=1100,['Pitch']=0,['Id']=1007,['SizeY']=1100,['EffectType']=463,['Yaw']=0,['Y']=11280,['Groups']=0,['X']=59521,['Roll']=0,},[3]={['Contrast']=1,['Id']=1009,['Roll']=0,['Alpha']=1,['Color']=999999,['SizeX']=800,['SizeZ']=1000,['Pitch']=0,['MetaData']={['heraldrycrestcolor']=173,['heraldrybkgstyle']=2,['heraldrybkgcolor1']=175,['heraldrybkgcolor2']=179,['heraldrycrestcat']=2,['heraldrybkgcat']=3,['guildid']=483106,['heraldrycreststyle']=7,},['SizeY']=1000,['EffectType']=649,['Yaw']=0.785398,['Y']=13802,['Groups']=0,['X']=55929,['Z']=75981,},[4]={['Contrast']=1,['Id']=1013,['Roll']=0,['Alpha']=1,['Color']=102439,['SizeX']=39.456456,['SizeZ']=52,['Pitch']=4.712564,['MetaData']={['title']='Sacred Knowledge',['message']='yo mom\\'s straight',},['SizeY']=52,['EffectType']=8503,['Yaw']=2.893756,['Y']=5038,['Groups']=0,['X']=55587,['Z']=73348,},[5]={['Contrast']=1,['Id']=1014,['Roll']=0,['Alpha']=1,['Color']=102439,['SizeX']=36.456456,['SizeZ']=50,['Pitch']=1.570971,['MetaData']={['title']='KINMUNE',['message']='KINMUNE (KINETICALLY-INTERLINKED MULTI-USER NTH-GEN EXOFORM)\\n\\nShe has many many names and titles, Queen Ayrenn. Oracle Iridescent. The Witch of Wire and String. The Doom of the Dumb Old Giant. The Ayrenn Araena Aldmeri. The Patricircumcision. Crystal-like-Twitch. The Thalmoric Memo-Whore to All Enemies In The \\'Set. 28th thot-box state-of-the-art half-shaft differential. Blessed Pentarch 5/5/555. Anuielectorate Article 1245663245.\\n\\nIf you should approach Queen Ayrenn, address her as none of these. Address her as Your Majesty KINMUNE and record what happens.\\n\\nANON/ANU/ANUI-EL: QUEEN AYREEN, DOMINION QUEEN [OLD MARY INTERREGNUM]\\n\\nShe started her existence as any other proxy-synthetic of the 9th Era aurbical mining guilds: a limited sentience deep-pressure capable \"thot-box\" - a dreamsleevishell used by remote mortal operators to run the rigs of Kynareth\\'s illicit breath trade.\\n\\nAble to stream several live-wire mortal proxies at once, Kinmune was a top-of-the-line Hazardous Conditions Warprunner Exoform of an ayleidoon hegemony nearing another unceremonious end.\\n\\nBut then the Hist-Jillian wars spilled out of a Wheelian rip into the SubSys slice of \\'brane-space, and things changed for Kinmune. With the outer colonies separated from Nu-Mundelbright chronoculic sync-net anchors, maintenance of space-time beyond the F-Shores faltered.\\n\\nAs the barely-there Hist blink-root-ship armada fired an artillery barrage of 16th-dimensional mathematics at their Jillian enemies, impossipoint detonations stippled across the Ix-Egg and its clutch-satellites like some garish TalOSian hologram, only without the irony.\\n\\nKinmune\\'s synthetic body, caught in one of the blasts, suddenly found itself in the Ysgramorim, her mind an aggregate of the residual personalities of her last several users.',},['SizeY']=50,['EffectType']=8503,['Yaw']=4.450590,['Y']=5183,['Groups']=0,['X']=54907,['Z']=73152,},[6]={['Color']=497999,['Z']=71049,['Alpha']=1,['Contrast']=2.900000,['SizeX']=1000,['SizeZ']=1000,['Pitch']=0,['Id']=1015,['SizeY']=1,['EffectType']=6,['Yaw']=4.658284,['Y']=11555,['Groups']=0,['X']=60242,['Roll']=0,},[7]={['Contrast']=1,['Id']=1016,['Roll']=0,['Alpha']=1,['Color']=102439,['SizeX']=42,['SizeZ']=50,['Pitch']=4.712564,['MetaData']={['title']='Guild List, Volume 1',['message']='Tanks\\n\\n\\nHonk Honk in Frontlinee\\n\\nRare specimen of a shadowscale. Equal in syphoning enemy\\'s health as in taking a great deal of pressure in the frontline. I\\'ll have to find out if he has a history of s-x working, there were some... reasons to do so.\\n\\nVismarcheg\\n\\nElusive nord hero that loves his heavy armor, sword and shield a bit too much. It is rumored that he can be summoned by call of Horn of Discord. It can\\'t be that easy, is it?\\n\\nUrburkul\\n\\nHistory is not clear about this man-mer, as he might be an orc, but many people who saw him describe him as breton, which is not consistent with his name.\\n\\n\\nHealers\\n\\n\\nSorilette Galione\\n\\nAnother strange man-mer. This one is breton for sure, but people can not pin-point their gender. One thing is sure - this is a damn good templar.\\n\\nLady Mindfang\\n\\nAnd another one... She comes from Rivenspire, from a vampire clan. At least that is what she says. But I really doubt she is even a vampire herself, too many animal companions.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nDamage Dealers\\n\\n\\nEredas Dorhan\\n\\nDunmer sorcerer of House Redoran. Surprisingly good with a blade and a bow. More surprising yet - sometimes he avoids using magic. It seems like he knows all the traits. \\n\\nAraana Telvanni\\n\\nDunmer sorcerer of House Telvanni. Despite the famed name, she is not that good with magic and seems to be afraid of summons and even living companions. Might have some connections with House Hlaalu.\\n\\nEiw La\\n\\nDunmer sor- necromancer. Came from Elsweyr, where she claimed to have seen dragons. For some reason she yells at her summoned dead a lot.\\n\\n\\nH\\'onk\\n\\nThat is the most confusing khajiit that I have ever dealt with. One day she is a thief, the other she is a jester, and then she will be a holy priestess, with whole attire. But I start to think that she is a werewolf.',},['SizeY']=50,['EffectType']=8503,['Yaw']=2.268928,['Y']=13112,['Groups']=0,['X']=56159,['Z']=76339,},[8]={['Contrast']=1,['Id']=1018,['Roll']=0,['Alpha']=1,['Color']=102439,['SizeX']=42.456456,['SizeZ']=50,['Pitch']=4.712564,['MetaData']={['title']='Guild List, Volume 2',['message']='Lielin Duskhollow\\n\\nA werewolf. Definetely a werewolf. I saw it with my own eyes.\\n\\nAphni Arnwasten \\n\\nFirst time I saw her, she was wearing antiquarian field garb, yet this dunmer did no digging as far as I\\'ve seen. Only shooting arrows... right in front of the enemy\\'s face.\\n\\nBattlereeve Linnmil\\n\\nSilent altmer dragonknight. Does his work and nothing more. Probably a Trinimac worshiper. Believed to be an impostor among Jephrine Paladins.\\n\\n???\\n\\nThere is a khajiit that claims to be H\\'onk\\'s long lost sister. Only Divines know if that is true, but both of them are shifty as khajiit can be...',},['SizeY']=50,['EffectType']=8503,['Yaw']=2.792527,['Y']=13035,['Groups']=0,['X']=55933,['Z']=76205,},[9]={['Color']=999998,['Z']=79436,['Alpha']=0.750000,['Contrast']=1.380000,['SizeX']=1024,['SizeZ']=512,['Pitch']=0,['Id']=1031,['SizeY']=512,['EffectType']=823,['Yaw']=1.595231,['Y']=11370,['Groups']=0,['X']=57888,['Roll']=0,},[10]={['Contrast']=1.250000,['Id']=1046,['Roll']=0,['Alpha']=1,['Color']=373737,['SizeX']=26.456456,['SizeZ']=30,['Pitch']=4.712564,['MetaData']={['title']='Grey Book',['message']='У дpугого входа каджит\\n\\nВcЯкое баpахло\\n\\nи cундуки cвои хpанит\\n\\nСколько их? Запомни чиcло\\n\\nРыжий бpетонец - к нему беги\\n\\nи чиcло пpокpичи',},['SizeY']=30,['EffectType']=8503,['Yaw']=1.570796,['Y']=2649,['Groups']=0,['X']=59510,['Z']=74713,},[11]={['Contrast']=1,['Id']=1047,['Roll']=0,['Alpha']=1,['Color']=829984,['SizeX']=26.456456,['SizeZ']=30,['Pitch']=4.712564,['MetaData']={['title']='RGB',['message']='В pайcком углу\\n\\nКультуpы pазных cоpтов\\n\\nКpаcные-Зеленые-Синие\\n\\nКлаcтеpы cветЯщихcЯ цветов\\n\\nСколько каких cкоплений? \\n\\nОни подcкажут тебе\\n\\nЧто именно нужно\\n\\nШепнуть мне',},['SizeY']=30,['EffectType']=8503,['Yaw']=4.363323,['Y']=11238,['Groups']=0,['X']=57032,['Z']=81130,},[12]={['Contrast'