R["fx__@ragefulpigeon"]="{['TS']=1621113360,['Key']='fx__@ragefulpigeon',['Houses']={[1]={['TS']=1618482596,['Version']='1710',['Effects']={[1]={['Roll']=0,['Y']=10598,['Z']=90727,['Yaw']=0.349066,['X']=105047,['Contrast']=1,['SizeX']=46.456456,['Pitch']=5.672320,['MetaData']={['title']='Trial of the Rageful Pigeon',['message']='Have you ever heard about Rageful Pigeon from Silent Guard? No? Lucky you! This bosmer is creator of this wierd place and he is complitely mad. He offers huge reward for \"simple\" task - finding little White Gold Tower. Many have tried to do this, almost all of them failed. Maybe you can become the new Champion of Pigeons?\\n\\nThere are many traps, dead ends and wrong ways, you will have to start the trial from beginning over and over again.\\n\\nIf you are still not scared... The start is near you. I\\'m waiting screenshot with your character, the tower and the horn in Discord (@ragefulpigeon). And remember:\\n\\nTHE CAKE IS LIE THE CAKE IS LIE THE CAKE IS LIE THE CAKE IS LIETHE CAKTHE CAKTHE CAKE IS LIEIS LIEIS LITHE CAKE IS LIEEE IS LIE',},['Groups']=0,['Alpha']=1,['SizeZ']=50,['SizeY']=50,['EffectType']=8502,['Id']=1001,['Color']=60243,},[2]={['Roll']=0,['Y']=10523,['Z']=88758,['Yaw']=0.261799,['X']=104218,['Contrast']=4,['SizeX']=46.456456,['Pitch']=4.886922,['MetaData']={['title']='The Hall of Fame',['message']='CHAMPIONS OF PIGEONS\\n\\n@Anumiell - the Greatest. The Creator of the Cake.\\n@Miunium - the Patient, the Tester.\\n\\n@JohnJS - the First, the Fastest. This khajiit overtook all runners.\\n@Ishnu01 - the Glorious. Got the legendary prize.\\n@h64 - the Bravest. Completed the way in lonelyness.',},['Groups']=0,['Alpha']=1,['SizeZ']=50,['SizeY']=50,['EffectType']=8502,['Id']=1004,['Color']=979998,},},['HouseId']=70,['World']='eu',},},}"
